// App.js
import { useEffect, useState } from "react";
import axios from "axios";
import { Line, Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
  TimeScale,
} from "chart.js";
import 'chartjs-adapter-date-fns';
import BuoyMap from './buoyMap'; //
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

function App() {
  // Navigation state
  const [currentView, setCurrentView] = useState('dashboard'); // 'dashboard', 'buoy_map', 'ai_agent'

  // Dashboard states
  const [stats, setStats] = useState({
    totalBuoys: 0,
    activeBuoys: 0,
    avgTemperature: 20.3,
    avgSalinity: 35.2,
    avgCurrentSpeed: 2.1,
    dataQuality: 98,
    buoysWithData: 0,
    buoysWithoutData: 0
  });
  const [networks, setNetworks] = useState({ OMNI: 0, RAMA: 0, ARGO: 0, MOORED: 0 });

  // ðŸ¤– Chatbot interface states
  const [chatMessages, setChatMessages] = useState([]);
  const [currentMessage, setCurrentMessage] = useState('');
  const [chatLoading, setChatLoading] = useState(false);

  // ðŸ¤– Dummy chat Q&A data
  const dummyQAData = [
    {
      question: "What is the current sea surface temperature in the Bay of Bengal?",
      answer: "Based on our RAMA and MOORED buoy data, the current sea surface temperature in the Bay of Bengal ranges from 28.2Â°C to 30.1Â°C. The northern regions show higher temperatures around 29.8Â°C, while southern areas average 28.5Â°C.",
      category: "Temperature"
    },
    {
      question: "How many active ocean buoys are currently operational?",
      answer: "We currently have 202 active ocean buoys operational across the Indian Ocean, including 25 RAMA buoys, 166 ARGO floats, and 11 MOORED buoys. All are providing real-time oceanographic data.",
      category: "Buoy Status"
    },
    {
      question: "What parameters can I monitor using INCOIS ocean buoys?",
      answer: "Our buoys monitor 53+ oceanographic parameters including sea surface temperature, salinity, wave height, wind speed/direction, air temperature, pressure, currents at various depths, and water temperature/salinity profiles up to 500m depth.",
      category: "Parameters"
    },
    {
      question: "How accurate is the real-time ocean data?",
      answer: "INCOIS ocean data is highly accurate with precision instruments. Temperature sensors have Â±0.1Â°C accuracy, salinity measurements have Â±0.02 PSU precision, and wind measurements are accurate to Â±0.5 m/s. Data undergoes quality control before distribution.",
      category: "Data Quality"
    }
  ];

  // Initialize chat with a welcome message
  useEffect(() => {
    setChatMessages([
      {
        id: 1,
        type: 'bot',
        message: "ðŸŒŠ Welcome to OceanFront! I can help you with questions about ocean buoys, real-time data, and oceanographic parameters. What would you like to know?",
        timestamp: new Date()
      }
    ]);
  }, []);

  // Handle chat message sending
  const sendChatMessage = () => {
    if (!currentMessage.trim()) return;

    const userMessage = {
      id: Date.now(),
      type: 'user',
      message: currentMessage,
      timestamp: new Date()
    };

    setChatMessages(prev => [...prev, userMessage]);
    setChatLoading(true);

    // Simulate bot response with dummy data
    setTimeout(() => {
      let bestMatch = dummyQAData[0]; // default
      let maxScore = 0;

      dummyQAData.forEach(qa => {
        const questionWords = qa.question.toLowerCase().split(' ');
        const messageWords = currentMessage.toLowerCase().split(' ');

        let score = 0;
        messageWords.forEach(word => {
          if (questionWords.some(qWord => qWord.includes(word) && word.length > 2)) {
            score++;
          }
        });

        if (score > maxScore) {
          maxScore = score;
          bestMatch = qa;
        }
      });

      const botMessage = {
        id: Date.now() + 1,
        type: 'bot',
        message: maxScore > 0 ? bestMatch.answer : "I understand you're asking about ocean data. For specific technical details, please use the INCOIS interface or contact our support team. Is there anything else about our buoy network I can help with?",
        timestamp: new Date(),
        category: maxScore > 0 ? bestMatch.category : 'General'
      };

      setChatMessages(prev => [...prev, botMessage]);
      setChatLoading(false);
    }, 1500);

    setCurrentMessage('');
  };

  // Quick question buttons
  const quickQuestions = [
    "Current temperature?",
    "Active buoys count?", 
    "Data accuracy?",
    "Available parameters?"
  ];

  const handleQuickQuestion = (question) => {
    setCurrentMessage(question);
    setTimeout(() => sendChatMessage(), 100);
  };

  // Fetch dashboard stats
  useEffect(() => {
    const fetchStats = async () => {
      try {
        console.log("ðŸ”„ Fetching dashboard stats...");
        const response = await axios.get("http://localhost:5000/api/ocean-buoys");

        if (response.data && response.data.success) {
          const totalBuoys = (response.data.argo?.length || 0) + 
                           (response.data.moored?.length || 0) + 
                           (response.data.rama?.features?.length || 0);

          setStats({
            totalBuoys,
            activeBuoys: totalBuoys, // Assuming all are active for demo
            avgTemperature: 20.3,
            avgSalinity: 35.2,
            avgCurrentSpeed: 2.1,
            dataQuality: 98,
            buoysWithData: Math.floor(totalBuoys * 0.8), // 80% have data
            buoysWithoutData: Math.floor(totalBuoys * 0.2)
          });

          setNetworks(response.data.networks || { OMNI: 0, RAMA: 0, ARGO: 0, MOORED: 0 });
        }
      } catch (err) {
        console.error("âŒ Error fetching stats:", err);
      }
    };

    fetchStats();
  }, []);

  // Render different views based on navigation
  const renderCurrentView = () => {
    switch (currentView) {
      case 'buoy_map':
        return <BuoyMap />;

      case 'ai_agent':
        return (
          <div className="min-h-screen bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 text-white">
            <div className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8 py-6">

              {/* AI Agent Interface */}
              <div className="bg-slate-800/50 backdrop-blur-sm rounded-2xl border border-slate-700/50 flex flex-col" style={{ height: '80vh' }}>
                <div className="p-4 border-b border-slate-700/50">
                  <div className="flex items-center">
                    <div className="w-8 h-8 bg-gradient-to-r from-cyan-400 to-blue-500 rounded-lg flex items-center justify-center mr-3">
                      <svg className="w-4 h-4 text-white" fill="currentColor" viewBox="0 0 24 24">
                        <path d="M9.663 17h4.673M12 3v1m6.364 1.636l-.707.707M21 12h-1M4 12H3m3.343-5.657l-.707-.707m2.828 9.9a5 5 0 117.072 0l-.548.547A3.374 3.374 0 0014 18.469V19a2 2 0 11-4 0v-.531c0-.895-.356-1.754-.988-2.386l-.548-.547z"/>
                      </svg>
                    </div>
                    <div>
                      <h3 className="text-lg font-semibold text-white">AI Agent</h3>
                      <p className="text-sm text-slate-400">Ocean Data Assistant</p>
                    </div>
                  </div>
                </div>

                <div className="flex-1 overflow-y-auto p-4 space-y-4 min-h-0">
                  {chatMessages.map((msg) => (
                    <div
                      key={msg.id}
                      className={`flex ${msg.type === 'user' ? 'justify-end' : 'justify-start'}`}
                    >
                      <div
                        className={`max-w-lg px-4 py-3 rounded-lg text-sm ${
                          msg.type === 'user'
                            ? 'bg-cyan-600 text-white rounded-br-none'
                            : 'bg-slate-700 text-white rounded-bl-none'
                        }`}
                      >
                        <p>{msg.message}</p>
                        <p className="text-xs opacity-70 mt-1">
                          {msg.timestamp.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}
                        </p>
                      </div>
                    </div>
                  ))}

                  {chatLoading && (
                    <div className="flex justify-start">
                      <div className="bg-slate-700 rounded-lg px-4 py-3 rounded-bl-none">
                        <div className="flex items-center space-x-1">
                          <div className="w-2 h-2 bg-slate-400 rounded-full animate-bounce"></div>
                          <div className="w-2 h-2 bg-slate-400 rounded-full animate-bounce" style={{animationDelay: '0.1s'}}></div>
                          <div className="w-2 h-2 bg-slate-400 rounded-full animate-bounce" style={{animationDelay: '0.2s'}}></div>
                        </div>
                      </div>
                    </div>
                  )}
                </div>

                <div className="p-4 border-t border-slate-700/50">
                  <div className="flex space-x-2 mb-3">
                    <input
                      type="text"
                      value={currentMessage}
                      onChange={(e) => setCurrentMessage(e.target.value)}
                      onKeyPress={(e) => e.key === 'Enter' && sendChatMessage()}
                      placeholder="Ask about ocean data..."
                      className="flex-1 bg-slate-700 border border-slate-600 rounded-lg px-4 py-2 text-sm text-white placeholder-slate-400 focus:ring-2 focus:ring-cyan-400 focus:border-transparent"
                      disabled={chatLoading}
                    />
                    <button
                      onClick={sendChatMessage}
                      disabled={chatLoading || !currentMessage.trim()}
                      className="bg-cyan-600 hover:bg-cyan-700 disabled:bg-slate-600 disabled:cursor-not-allowed text-white rounded-lg px-4 py-2 text-sm font-medium transition-colors"
                    >
                      <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8"/>
                      </svg>
                    </button>
                  </div>

                  {/* Quick Questions */}
                  <div className="flex flex-wrap gap-2">
                    {quickQuestions.map((question, index) => (
                      <button
                        key={index}
                        onClick={() => handleQuickQuestion(question)}
                        className="text-xs bg-slate-700 hover:bg-slate-600 text-slate-300 hover:text-white rounded-md px-3 py-1 transition-colors"
                        disabled={chatLoading}
                      >
                        {question}
                      </button>
                    ))}
                  </div>
                </div>
              </div>
            </div>
          </div>
        );

      default: // dashboard
        return (
          <div className="min-h-screen bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 text-white">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">

              {/* Current Conditions Summary */}
              <div className="mb-6">
                <div className="bg-slate-800/50 backdrop-blur-sm rounded-2xl border border-slate-700/50 p-6">
                  <div className="flex items-center justify-between mb-6">
                    <div className="flex items-center">
                      <svg className="w-5 h-5 text-cyan-400 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"/>
                      </svg>
                      <h2 className="text-lg font-semibold text-white">Current Conditions Summary</h2>
                    </div>
                  </div>

                  <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-6">
                    {/* Temperature */}
                    <div className="text-center">
                      <div className="flex items-center justify-center mb-2">
                        <svg className="w-5 h-5 text-blue-400 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19.4l.7-.7c.4-.4.6-1 .6-1.6V9c0-1.1.9-2 2-2s2 .9 2 2v8.1c0 .6.2 1.2.6 1.6l.7.7c.4.4.4 1 0 1.4-.2.2-.4.3-.7.3h-6c-.3 0-.5-.1-.7-.3-.4-.4-.4-1 0-1.4z"/>
                        </svg>
                        <span className="text-sm text-slate-400">Temperature</span>
                      </div>
                      <div className="text-2xl font-bold text-white mb-1">{stats.avgTemperature}Â°C</div>
                      <div className="text-xs text-green-400">+0.8Â°C from avg</div>
                    </div>

                    {/* Current Speed */}
                    <div className="text-center">
                      <div className="flex items-center justify-center mb-2">
                        <svg className="w-5 h-5 text-green-400 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M13 10V3L4 14h7v7l9-11h-7z"/>
                        </svg>
                        <span className="text-sm text-slate-400">Current Speed</span>
                      </div>
                      <div className="text-2xl font-bold text-white mb-1">{stats.avgCurrentSpeed} m/s</div>
                      <div className="text-xs text-orange-400">Moderate</div>
                    </div>

                    {/* Salinity */}
                    <div className="text-center">
                      <div className="flex items-center justify-center mb-2">
                        <svg className="w-5 h-5 text-orange-400 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19.428 15.428a2 2 0 00-1.022-.547l-2.387-.477a6 6 0 00-3.86.517l-.318.158a6 6 0 01-3.86.517L6.05 15.21a2 2 0 00-1.806.547M8 4h8l-1 1v5.172a2 2 0 00.586 1.414l5 5c1.26 1.26.367 3.414-1.415 3.414H4.828c-1.782 0-2.674-2.154-1.414-3.414l5-5A2 2 0 009 10.172V5L8 4z"/>
                        </svg>
                        <span className="text-sm text-slate-400">Salinity</span>
                      </div>
                      <div className="text-2xl font-bold text-white mb-1">{stats.avgSalinity} PSU</div>
                      <div className="text-xs text-slate-400">Normal</div>
                    </div>

                    {/* Data Quality */}
                    <div className="text-center">
                      <div className="flex items-center justify-center mb-2">
                        <svg className="w-5 h-5 text-pink-400 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z"/>
                        </svg>
                        <span className="text-sm text-slate-400">Data Quality</span>
                      </div>
                      <div className="text-2xl font-bold text-white mb-1">{stats.dataQuality}%</div>
                      <div className="text-xs text-green-400">Excellent</div>
                    </div>
                  </div>

                  {/* Key Insights */}
                  <div className="bg-slate-700/30 rounded-lg p-4">
                    <h3 className="text-sm font-semibold text-white mb-3">Key Insights</h3>
                    <div className="space-y-2 text-sm text-slate-400">
                      <div>â€¢ Sea surface temperature is 0.8Â°C above seasonal average</div>
                      <div>â€¢ Current patterns indicate strengthening El NiÃ±o conditions</div>
                      <div>â€¢ Thermocline depth has increased by 15m over the past week</div>
                      <div>â€¢ Model confidence remains high for next 6-hour predictions</div>
                    </div>
                  </div>
                </div>
              </div>

              {/* Charts Section */}
              <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 mb-6">
                {/* Sea Surface Temperature Chart */}
                <div className="bg-slate-800/50 backdrop-blur-sm rounded-2xl border border-slate-700/50 p-6">
                  <div className="flex items-center justify-between mb-4">
                    <div className="flex items-center">
                      <svg className="w-5 h-5 text-blue-400 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19.4l.7-.7c.4-.4.6-1 .6-1.6V9c0-1.1.9-2 2-2s2 .9 2 2v8.1c0 .6.2 1.2.6 1.6l.7.7c.4.4.4 1 0 1.4-.2.2-.4.3-.7.3h-6c-.3 0-.5-.1-.7-.3-.4-.4-.4-1 0-1.4z"/>
                      </svg>
                      <h3 className="text-lg font-semibold text-white">Sea Surface Temperature</h3>
                    </div>
                  </div>
                  <div className="h-64 bg-slate-700/30 rounded-lg flex items-center justify-center">
                    <div className="text-slate-400 text-sm">Chart visualization would go here</div>
                  </div>
                </div>

                {/* Temperature Predictions */}
                <div className="bg-slate-800/50 backdrop-blur-sm rounded-2xl border border-slate-700/50 p-6">
                  <div className="flex items-center justify-between mb-4">
                    <div className="flex items-center">
                      <svg className="w-5 h-5 text-orange-400 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M13 10V3L4 14h7v7l9-11h-7z"/>
                      </svg>
                      <h3 className="text-lg font-semibold text-white">Temperature Predictions</h3>
                    </div>
                    <div className="flex items-center text-xs text-green-400 bg-green-400/10 rounded-full px-2 py-1">
                      <div className="w-2 h-2 bg-green-400 rounded-full mr-1"></div>
                      ML Model: LSTM
                    </div>
                  </div>
                  <div className="h-64 bg-slate-700/30 rounded-lg flex items-center justify-center">
                    <div className="text-slate-400 text-sm">Prediction chart would go here</div>
                  </div>
                </div>
              </div>

              {/* Network Statistics */}
              <div className="bg-slate-800/50 backdrop-blur-sm rounded-2xl border border-slate-700/50 p-6">
                <h3 className="text-lg font-semibold text-white mb-4 flex items-center">
                  <svg className="w-5 h-5 text-cyan-400 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"/>
                  </svg>
                  Network Statistics
                </h3>

                <div className="grid grid-cols-2 md:grid-cols-6 gap-4">
                  <div className="text-center">
                    <div className="text-2xl font-bold text-white mb-1">{stats.totalBuoys}</div>
                    <div className="text-sm text-slate-400">Total Buoys</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-green-400 mb-1">{stats.activeBuoys}</div>
                    <div className="text-sm text-slate-400">Active</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-cyan-400 mb-1">{stats.buoysWithData}</div>
                    <div className="text-sm text-slate-400">With Data</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-green-400 mb-1">{networks.RAMA}</div>
                    <div className="text-sm text-green-400">RAMA</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-purple-400 mb-1">{networks.ARGO}</div>
                    <div className="text-sm text-purple-400">ARGO</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-orange-400 mb-1">{networks.MOORED}</div>
                    <div className="text-sm text-orange-400">MOORED</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900">
      {/* Header - OceanFront Style */}
      <header className="bg-slate-900/95 backdrop-blur-sm border-b border-slate-800/50 sticky top-0 z-50">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center space-x-3">
              <div className="flex items-center space-x-2">
                <div className="w-8 h-8 bg-gradient-to-r from-cyan-400 to-blue-500 rounded-lg flex items-center justify-center">
                  <svg className="w-5 h-5 text-white" fill="currentColor" viewBox="0 0 24 24">
                    <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z"/>
                  </svg>
                </div>
                <div>
                  <h1 className="text-xl font-bold text-white">OceanFront</h1>
                  <p className="text-xs text-slate-400">Oceanographic Data Platform</p>
                </div>
              </div>
            </div>

            <nav className="flex space-x-6">
              <button 
                onClick={() => setCurrentView('dashboard')}
                className={`flex items-center px-3 py-2 text-sm font-medium rounded-lg transition-colors ${
                  currentView === 'dashboard' 
                    ? 'text-white bg-slate-800' 
                    : 'text-slate-400 hover:text-white'
                }`}
              >
                <svg className="w-4 h-4 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"/>
                </svg>
                Dashboard
              </button>
              <button 
                onClick={() => setCurrentView('buoy_map')}
                className={`flex items-center px-3 py-2 text-sm font-medium rounded-lg transition-colors ${
                  currentView === 'buoy_map' 
                    ? 'text-white bg-slate-800' 
                    : 'text-slate-400 hover:text-white'
                }`}
              >
                <svg className="w-4 h-4 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"/>
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"/>
                </svg>
                Buoy Map
              </button>
              <button 
                onClick={() => setCurrentView('ai_agent')}
                className={`flex items-center px-3 py-2 text-sm font-medium rounded-lg transition-colors ${
                  currentView === 'ai_agent' 
                    ? 'text-white bg-slate-800' 
                    : 'text-slate-400 hover:text-white'
                }`}
              >
                <svg className="w-4 h-4 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9.663 17h4.673M12 3v1m6.364 1.636l-.707.707M21 12h-1M4 12H3m3.343-5.657l-.707-.707m2.828 9.9a5 5 0 117.072 0l-.548.547A3.374 3.374 0 0014 18.469V19a2 2 0 11-4 0v-.531c0-.895-.356-1.754-.988-2.386l-.548-.547z"/>
                </svg>
                AI Agent
              </button>
            </nav>
          </div>
        </div>
      </header>

      {/* Main Content - Render based on current view */}
      {renderCurrentView()}
    </div>
  );
}
